- name: URL-TEST
  type: url-test
  url: http://www.v2ex.com/generate_204
  interval: 300
  proxies: *id001
- name: FALLBACK
  type: fallback
  url: http://www.v2ex.com/generate_204
  interval: 300
  proxies: *id001
- name: LOAD-BALANCE
  type: load-balance
  url: http://www.v2ex.com/generate_204
  interval: 300
  strategy: round-robin
  proxies: *id001
rules:
  - RULE-SET,advertising,REJECT
  - RULE-SET,applications,DIRECT
  - RULE-SET,icloud,DIRECT
  - RULE-SET,apple,DIRECT
  - RULE-SET,github,PROXY
  - RULE-SET,google,PROXY
  - RULE-SET,youtube,PROXY
  - RULE-SET,telegram,PROXY
  - RULE-SET,spotify,DIRECT
  - RULE-SET,gfw,PROXY
  - GEOIP,LAN,DIRECT
  - GEOIP,CN,DIRECT
  - MATCH,DIRECT

